// src/components/Aside.js
import React from 'react';
import getClothingSuggestions from './ClothingSuggestions';

const Aside = ({ temperature, description }) => {
  const clothingSuggestions = getClothingSuggestions(temperature, description);

  return (
    <aside>
      <h3>Clothing Suggestions</h3>
      <p>{clothingSuggestions}</p>
    </aside>
  );
};

export default Aside;
